library Types {
      struct DirectiveVotes {
        uint256 yes;
        uint256 no;
        uint256 abstain;
    }

    struct Candidate {
        string name;
        address candidateAddress;
        uint256 votes;
    }
    struct Member{
        string name;
        bool isEligible;
        bool isVoted;
        address memberAddress;
    }   
