        string title;
        string description;
        string draftedBy;
        bool isElection;
        bool isActive;
        DirectiveVotes votes;
        Candidate[] candidates;
        Member[] voters;
        }
    struct MemberInput {
        address memberAddress;
        string name;
        uint256 teamId;
        }

}

